  and cane processors and cane refiners in the U.S. are required by the FAIR Act of
  1996, as amended, to report data on physical quantities delivered by use in the
  New England region on a monthly basis.  Uses include \"Bakery, Cereal and Related
  Products\"; \"Confectionery and Related Products\"; \"Ice Cream and Related Products\";
  \"Beverages\"; \"Canned, Bottled and Frozen Foods\"; \"Multiple and All Other Food
  Uses\", \"Non-Food Uses\", \"Hotels, Restaurants  and Institutions\";  \"Wholesale
  Grocers, Jobbers and Dealers\", \"Retail Grocers and Chain Stores\", \"Deliveries
